  color: #000000;
  font-family: roboto;
  font-size: 14px;
  font-weight: 400;

  opacity: 1; /* Firefox */
  }
  #_builder-form ::placeholder {
    color: #AFB8BC !important;
    font-family: roboto;
    font-size: 14px;
    font-weight: 400;
  }
  #_builder-form :-ms-input-placeholder { /* Internet Explorer 10-11 */
    color: #AFB8BC !important;
    font-family: roboto;
    font-size: 14px;
    font-weight: 400;
  }
  #_builder-form ::-ms-input-placeholder { /* Microsoft Edge */
    color: #AFB8BC !important;
    font-family: roboto;
    font-size: 14px;
    font-weight: 400;
  }

  #_builder-form label{ 
    color:#000000;
    font-family: roboto;
    font-size: 14px;
    font-weight: 400;
  }
  #_builder-form .short-label{ 
    color:#464d5f;
    font-family: Roboto;
    font-size: 12px;
    font-weight: 300;
    -webkit-font-smoothing: auto;
  }
  #_builder-form .form-builder--item .payment-suggestion-tag-container {
